def ger_reorder_tag(val, template):
    low = 0
    high = len(template)
    while low < high:
        mid = (low + high) // 2
        mid_val = template[mid]
        if val == mid_val:
            return mid
        elif val > mid_val:
            low = mid + 1
        else:
            high = mid
    raise ValueError("unknow found val: {}".format(val))


